class IssueTracker:
    def __init__(self):
        self.issues = []

    def log_issue(self, description):
        issue_id = len(self.issues) + 1
        self.issues.append({"id": issue_id, "description": description, "status": "logged"})
        return issue_id

    def update_issue(self, issue_id, status):
        for issue in self.issues:
            if issue["id"] == issue_id:
                issue["status"] = status
                return True
        return False

