class SubmissionManager:
    def __init__(self):
        self.submissions = set()

    def submit_data(self, data_id):
        if data_id in self.submissions:
            raise Exception("Duplicate submission detected.")
        self.submissions.add(data_id)
        return "Submission successful."

class ErrorClarifier:
    def __init__(self):
        self.error_codes = {}

    def add_error_code(self, code, message):
